?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Наверное, любой человек, который более или менее причастен к часовой сфере, слышал о такой фабрике, как ETA. И неудивительно, потому что она производит самые высококачественные механизмы для часов. Множество знаменитых и популярных фирм, производящих часы, оптовыми партиями закупают известные механизмы. По сути, ETA это объединение независимых фабрик, которые производят механизмы и запчасти к ним. Точкой отсчета деятельности фабрики ETA традиционно считается 1856 год. В этом году доктор Жирар и Урс Шилд приняли решение об основании фабрики по производству стандартных механизмов для часов в городе Грехен. Каждый год фабрика старается усовершенствовать и улучшить свои механизмы, и у них это получается весьма неплохо. Об этом свидетельствуют многочисленные договора с многими знаменитыми компаниями по производству часов.</span></span></p>
 
